package shane.leetcode.problems.easy;

import org.junit.jupiter.api.Test;

import static org.assertj.core.api.Assertions.assertThat;

public class Q680ValidPalindromeII {

    @Test
    public void test() {
        assertThat(validPalindrome("aba")).isTrue();
        assertThat(validPalindrome("abca")).isTrue();
        assertThat(validPalindrome("abc")).isFalse();
        assertThat(validPalindrome("a")).isTrue();
        // 416 ms TLE
        assertThat(validPalindrome("")).isTrue();
    }

    public boolean validPalindrome(String s) {
        if (isPalindrome(s))
            return true;
        for (int i = 0; i < s.length(); i++) {
            StringBuilder sb = new StringBuilder(s);
            sb.deleteCharAt(i);
            if (isPalindrome(sb.toString()))
                return true;
        }
        return false;
    }

    private boolean isPalindrome(String s) {
        int left = 0;
        int right = s.length() - 1;
        while (left < right) {
            if (s.charAt(left++) != s.charAt(right--)) {
                return false;
            }
        }
        return true;
    }
}
